import React, { Component } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Row, Col } from 'reactstrap';
import { Button } from 'reactstrap';
import './Home.css';

class Home extends Component {
    render() {
        return (
            <Container>
                <Row>
                    <Col className="Picker" xs="6">
                        <Row className="Picker-head">
                            <Col>Color Picker</Col>
                        </Row>
                        <Row className="Picker-body">
                            <Col>List Color</Col>
                        </Row>
                    </Col>
                    <Col className="setSize" xs="6">
                        <Row className="setSize-head">
                            <Col>Size : 12px</Col>
                        </Row>
                        <Row className="setSize-body">
                            <Col xs="2" >
                                <Button color="success">success</Button>{' '}
                            </Col>

                            <Col xs="6">
                                <Button color="success">success</Button>{' '}
                            </Col>
                        </Row>
                        <Button color="primary">reset</Button>{' '}
                    </Col>
                </Row>
                <Row className="settingContent" xs="1">
                    <Row>
                        <Col>Color: red</Col>
                    </Row>
                    <Row className="settingContent-body">
                        <Col>Nội dung setting</Col>
                    </Row>
                </Row>
            </Container>
        )
    }
}

export default Home;
